import React from "react";
import styles from "./Footer.module.scss"; 
import { FaGithub, FaYoutube, FaEnvelope } from "react-icons/fa"; 

const Footer = () => {
  return (
    <footer className={styles.footer}>
      <div className={styles.container}>
        {/* Left Side - API Name */}
        <div className={styles.left}>
          <h2>My API</h2>
          <p>Reliable and fast API for your needs.</p>
        </div>

        {/* Middle - Quick Links */}
        <div className={styles.middle}>
          <h3>Quick Links</h3>
          <ul>
            <li><a href="/docs">Docs</a></li>
            <li><a href="/pricing">Pricing</a></li>
            <li><a href="/contact">Contact</a></li>
          </ul>
        </div>

        {/* Right Side - Social Links */}
        <div className={styles.right}>
          <h3>Follow Us</h3>
          <div className={styles.socialIcons}>
            <a href="https://github.com" target="_blank" rel="noopener noreferrer"><FaGithub /></a>
            <a href="https://youtube.com" target="_blank" rel="noopener noreferrer"><FaYoutube /></a>
            <a href="mailto:example@example.com"><FaEnvelope /></a>
          </div>
        </div>
      </div>

      <div className={styles.bottom}>
        <p>Â© {new Date().getFullYear()} My API. All rights reserved.</p>
        <div className={styles.terms}>
          <a href="/privacy">Privacy Policy</a> | <a href="/terms">Terms & Conditions</a>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
